import React, { useEffect, useState } from "react";
import axios from "axios";

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = { resultado: "", porcentaje: 0 };
  }
  changeHandler = (e) => {
    const el = e.target;
    this.setState({
      [el.name]: el.type === "file" ? el.files[0] : el.value,
    });
  };

  submitImg = (e) => {
    e.preventDefault();

    const bodyFormData = new FormData(e.target);

    axios
      .post("http://127.0.0.1:8000/detectar-objeto", bodyFormData)
      .then((result) => {
        console.log("success", result);
        this.setState({
          resultado: result.data.detectado,
          porcentaje: result.data.porcentaje,
        });
        console.log(this.state);
      })
      .catch((error) => {
        console.log("la cagamos");
      });
  };

  render() {
    return (
      <body>
        <h2>Detectar Objeto</h2>
        <form onSubmit={this.submitImg} encType="multipart/form-data">
          <input type="file" name="img1" />
          <button type="submit">Submit</button>
          <p></p>
        </form>
      </body>
    );
  }
}
export default Home;
